import { LOGIN, SIGNOUT} from "./Action"

const initialState = {
    isloggedIn: false
  }

const Reducer = (state = initialState, action) => {
    switch (action.type) {
        case LOGIN:
            return state

        case SIGNOUT:
            return state

        default:
            return state;
    }
}

export default Reducer
